import React from 'react';
import Navbar from './components/Navbar';
import Footer from './components/Footer';

import HomePage from '/Users/divayanshisharama/Desktop/JAI/src/components/Homepage.js';
import CareersPage from '/Users/divayanshisharama/Desktop/JAI/src/components/Career.js';

import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div>
        <Navbar />
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/careers" element={<CareersPage />} />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
